  const [list, setList] = useState([]);

  // useEffect(() => {
  //   getList();
  // },[]);

  const getList = async () => {
    const response = axios.get('http://localhost:3001/obat')
    await console.log(response.data)
  }

  return (
    <div className="tableList">
      <table>
        <thead>
          <tr>
            <th>No</th>
            <th>Nama</th>
            <th>Jumlah</th>
            <th>Harga</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th></th>
            <th></th>
            <th></th>
            <th></th>
          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default dataObat;
